INSERT INTO `products` VALUES (1,'Base','10',_binary 'data:image/png;base64,','Базовый курс','\"Добро пожаловать на базовый курс по изучению Python! Этот курс предназначен для тех, кто только начинает свой путь в мир программирования или желает освежить свои знания. Python - мощный и простой в изучении язык программирования, и этот курс поможет вам освоить его основы.\r\n\r\nЧто вы узнаете:\r\n\r\nОсновы синтаксиса Python: переменные, типы данных, операторы.\r\nКонтроль выполнения программы: условия, циклы.\r\nСтруктуры данных: списки, кортежи, словари.\r\nФункции и модули: создание и использование.\r\nРабота с файлами и обработка ошибок.\r\nМы предоставим вам интерактивные задания, практические примеры и проекты, чтобы вы могли применить полученные знания на практике. Научитесь писать эффективный и читаемый код, что является важным навыком для любого программиста.\r\n\r\nНе имеет значения, являетесь ли вы начинающим или опытным программистом, этот курс откроет перед вами двери в увлекательный мир Python и подготовит вас к решению реальных задач. Присоединяйтесь и начнем путешествие в мир программирования с Python!\"'),(2,'Advanced','30',_binary 'data:image/png;base64,','Продвинутый курс','\"Добро пожаловать на продвинутый курс по Python! Этот курс разработан для опытных программистов, уже имеющих базовые знания Python, и готовых углубиться в более сложные и интересные аспекты языка.\r\n\r\nЧто вас ждет на этом курсе:\r\n\r\nРабота с продвинутыми структурами данных: множества, стеки, очереди.\r\nПродвинутое использование функций и лямбда-выражений.\r\nОбработка исключений и отладка кода.\r\nООП (объектно-ориентированное программирование) в Python: классы, наследование, полиморфизм.\r\nРабота с внешними библиотеками и API.\r\nАсинхронное программирование и многозадачность.\r\nМы предоставим вам сложные задачи, проекты реального мира и возможность углубиться в темы, которые вас интересуют. Вы научитесь создавать высокопроизводительный и масштабируемый код, а также освоите передовые методы разработки.\r\n\r\nПрисоединяйтесь к нам, чтобы стать экспертом по Python и готовым к созданию сложных программных решений!\"'),(3,'Python killer','50',_binary 'data:image/jpeg;base64,','Профессионал ','\"Добро пожаловать на профессиональный курс Python для опытных разработчиков! Этот курс предназначен для тех, кто уже обладает обширным опытом работы с Python и стремится к мастерству в языке программирования.\r\n\r\nЧто вас ожидает на этом курсе:\r\n\r\nГлубокое погружение в продвинутые темы языка Python, включая метаклассы, декораторы и многопоточность.\r\nРазработка высокоэффективных и оптимизированных приложений.\r\nПроектирование и создание распределенных систем на основе Python.\r\nПогружение в архитектурные паттерны и лучшие практики программирования.\r\nЭффективное использование инструментов автоматизации и тестирования.\r\nГлубокий анализ производительности и оптимизация кода.\r\nНаши экспертные лекторы и практические проекты помогут вам стать мастером Python, способным решать сложные задачи и разрабатывать выдающиеся программные продукты.\r\n\r\nПрисоединяйтесь к курсу и поднимите свои навыки Python на новый уровень, готовый к решению самых сложных задач в мире программирования.\"');
